# @lc code=start
class Solution:
    def reindex(self, index: int, n: int):
        return (2*index+1) % (n|1)
        
    def quick_select(self, nums: List[int], k: int, start: int, end: int, mapping: list):
        pivot = start
        p = start
        n = len(nums)
        for index in range(start+1, end):
            if nums[mapping[index]] > nums[mapping[pivot]]:
                p += 1
                nums[mapping[index]], nums[mapping[p]] = nums[mapping[p]], nums[mapping[index]]

        nums[mapping[pivot]], nums[mapping[p]] = nums[mapping[p]], nums[mapping[pivot]]

        return nums, p

    def quick_select_recursive(self, nums: List[int], kth: int, start: int, end: int, mapping: list):
        nums, pivot = self.quick_select(nums, kth, start, end, mapping)
        if kth == pivot:
            return pivot
        elif kth < pivot:
            return self.quick_select_recursive(nums, kth, start, pivot, mapping)
        else:
            return self.quick_select_recursive(nums, kth, pivot+1, end, mapping)
    
    def wiggleSort(self, nums: List[int]) -> None:
        """
        Do not return anything, modify nums in-place instead.
        """
        mapping = [self.reindex(i, len(nums)) for i in range(len(nums))]
        median_index = self.quick_select_recursive(nums, (len(nums))//2, 0, len(nums), mapping)
